fdf3863c5fc0165af53ae7084535f54e089f2640.source:
query LogInEmail($email: EmailAddress!, $password: String!) {
  logInEmail(email: $email, password: $password) {
    __typename
    ...LoginResponse
  }
}
fragment LoginResponse on AuthenticationResponse {
  __typename
  code
  token
  message
  success
  user {
    __typename
    ...UserDetails
  }
}
fragment UserDetails on User {
  __typename
  id
  prefix
  givenName
  middleName
  lastName
  role
}

